package golib

import (
	"reflect"
	"unsafe"
)

type DispatchMessage interface {
	DispatchKey() interface{}
}

// Generated by ArrayDispatcher.Add() or MapDispatcher.Add()
type DispatchKeyMixin /* implement DispatchMessage */ struct {
	dispatcher unsafe.Pointer
	key        uintptr
}

func (o DispatchKeyMixin) DispatchKey() interface{} {
	return o
}

type TypeDispatchKeyMixin /* implement DispatchMessage */ struct {
	reflect.Type
}

func (o TypeDispatchKeyMixin) DispatchKey() interface{} {
	return o.Type
}
